app.view.Clipboard = function() {
	this.init();
};

app.view.Clipboard.prototype = {

	// Clipboard icon selector
	clipboardCls: 'copy-icon',
	// Timeout value for clipboard tooltip in ms
	timeoutDuration: 3000,

	init: function() {
		this.clipboard = new Clipboard('.' + this.clipboardCls);

		var clipboard = new Clipboard('.copy-icon');
		clipboard.on('success', function(e) {
			e.trigger.className += ' copied';
			setTimeout(function(){e.trigger.className = 'copy-icon';}, 3000);
			e.clearSelection();
		});

		clipboard.on('error', function(e) {
			e.trigger.className += ' error';
			setTimeout(function(){e.trigger.className = 'copy-icon';}, 3000);
		});
	},

	onClipBoardSuccess: function(ev) {
		ev.trigger.className += ' copied';
		setTimeout(function(){ev.trigger.className = this.clipboardCls;}, this.timeoutDuration);
		ev.clearSelection();
	},

	onClipBoardError: function(ev) {
		ev.trigger.className += ' error';
		setTimeout(function(){ev.trigger.className = this.clipboardCls;}, this.timeoutDuration);
	},

	bind: function() {
		this.clipboard.on('success', $.proxy(this.onClipBoardSuccess, this));
		this.clipboard.on('error', $.proxy(this.onClipBoardError, this));
	}
	
};
app.view.CodeMirror = function() {
	this.init();
};

app.view.CodeMirror.prototype = {

	// Haxe code marker css selector
	haxeCodeSel: '.code-haxe',
	// XML code fragment selector
	xmlCodeSel: '.code-xml',
	// CodeMirror config
	codeMirrorConfig: {
		mode: "haxe",
		lineNumbers: true,
		theme: "hexmachina",
		lineWrapping: true,
		readOnly: true,
		extraKeys: {
			"Ctrl-Q": function (cm) {
				cm.foldCode(cm.getCursor());
			}
		},
		foldGutter: true,
		gutters: ["CodeMirror-linenumbers", "CodeMirror-foldgutter"]
	},

	init: function() {
		this.haxeCodeFragments = $(this.haxeCodeSel);
		this.xmlCodeFragments = $(this.xmlCodeSel);
		this.placeCodeMirrors();
	},

	placeCodeMirrors: function() {
		var i,
			fragmentsLength = this.haxeCodeFragments.length,
			xmlCodeFragmentsLength = this.xmlCodeFragments.length;

		for (i = 0; i < fragmentsLength; i++) {
			CodeMirror.fromTextArea(this.haxeCodeFragments.get(i), this.codeMirrorConfig);
		}
		for (i = 0; i < xmlCodeFragmentsLength; i++) {
			CodeMirror.fromTextArea(this.xmlCodeFragments.get(i), this.codeMirrorConfig);
		}
	}

};

app.view.GoogleSearch = function() {
	this.init();
	this.bind();
};

app.view.GoogleSearch.prototype = {

	// Toggle search button selector
	toggleSearchBtnSel: '.toggle-search',
	// Class that will make the search visible
	searchEnabledCls: 'search-enabled',
	// Wrapper selector for search
	searchFieldCls: '.google-search',
	// Google search element
	apiTag: '<gcse:search></gcse:search>',

	init: function() {
		this.body = $(document.body);
		this.searchField = $(this.searchFieldCls);
		this.toggleSearchButtons = $(this.toggleSearchBtnSel);

		this.initSearch();
	},

	toggleSearchVisibility: function() {
		this.body.toggleClass(this.searchEnabledCls);
		if (!this.body.hasClass(this.searchEnabledCls)) {
			this.resetGoogleSearchApi();
		}
	},

	resetGoogleSearchApi: function() {
		this.searchField.html(this.apiTag);
		this.initSearch();
	},

	initSearch: function() {
		var cx = '010997690404295003250:ejhhrxabuqc';
		var gcse = document.createElement('script');
		gcse.type = 'text/javascript';
		gcse.async = true;
		gcse.src = 'https://cse.google.com/cse.js?cx=' + cx;
		var s = document.getElementsByTagName('script')[0];
		s.parentNode.insertBefore(gcse, s);
	},

	bind: function() {
		this.toggleSearchButtons.click($.proxy(this.toggleSearchVisibility, this))
	}

};
app.view.MobileMenu = function() {
	this.init();
	this.bind();
};

app.view.MobileMenu.prototype = {

	// Mobile menu icon class
	mobileMenuSel: '.mobile-menu',
	// This makes the mobile menu visible
	mobileMenuActiveCls: 'mobile-menu-on',

	init: function() {
		this.body = $(document.body);
		this.mobileMenu = $(this.mobileMenuSel);
	},

	toggleMobileMenu: function() {
		if (this.body.hasClass(this.mobileMenuActiveCls)) {
			this.body.removeClass(this.mobileMenuActiveCls);
			this.setTouchMove();
		}
		else {
			this.body.addClass(this.mobileMenuActiveCls);
			this.setTouchMove();
		}
	},

	setTouchMove: function() {
		if (this.body.hasClass(this.mobileMenuActiveCls)) {
			if (window.innerHeight <= 450) {
				this.body.off('touchmove', $.proxy(this.onTouchMove, this));
			}
			else {
				this.body.on('touchmove', $.proxy(this.onTouchMove, this));
			}
		}
		else {
			this.body.off('touchmove', $.proxy(this.onTouchMove, this));
		}
	},

	onOrientationChange: function() {
		this.setTouchMove();
	},

	onTouchMove: function(ev) {
		ev.preventDefault();
	},

	bind: function() {
		this.mobileMenu.click($.proxy(this.toggleMobileMenu, this));
		this.body.on('orientationchange', $.proxy(this.onOrientationChange, this));
	}

};
app.ReadMore = function(elSel, showMoreText, showLessText) {
	this.initialize(elSel, showMoreText, showLessText);
	this.addEvents();
};

app.ReadMore.prototype = {

	// Read more button selector
	readMoreBtnSel: '.read-more',
	// These elements will be visible after clicking .read-more
	revealSel: '.reveal',
	// Selector for hidden items should be revealed
	hideCls: 'hide',
	// Code mirror selector
	codeMirrorSel: '.CodeMirror',
	// Pages enabled for auto toggling visibility
	autoTogglePageClasses: ['home'],


	initialize: function(elSel, showMoreText, showLessText) {
		this.body = $(document.body);
		this.el = $(elSel);
		this.codeMirrorItems = this.el.find(this.codeMirrorSel);
		this.showMoreText = showMoreText;
		this.showLessText = showLessText;
		this.showMoreBtn = this.el.find(this.readMoreBtnSel);
		this.hiddenItems = this.el.find(this.revealSel);

		if (this.body.attr('class').indexOf(this.autoTogglePageClasses) !== -1) {
			setTimeout(this.toggleVisibility.bind(this), 0);
		}
	},

	/**
	 * Triggers visibility change on .reveal elements
	 * Refreshes codemirror items
	 * Changes text if params given at instantiation
	 *
	 * @param {object} ev   Event Object
	 *
	 * @return {void}
	 */
	onShowMoreButtonClick: function(ev) {
		console.info('#onShowMoreButtonClick');
		ev.preventDefault();
		var target = $(ev.target);
		this.toggleVisibility();
		this.refreshCodeMirror();
		this.changeText(target);
	},

	refreshCodeMirror: function() {
		this.codeMirrorItems.each(function(i, el) {
			el.CodeMirror.refresh();
		});
	},

	changeText: function(target) {
		if (this.showMoreText && target.html() === this.showMoreText) {
			target.html(this.showLessText);
		}
		else if (this.showMoreText && target.html() === this.showLessText) {
			target.html(this.showMoreText);
			target.get(0).scrollIntoView();
		}
	},

	toggleVisibility: function() {
		if (this.hiddenItems.hasClass(this.hideCls)) {
			this.hiddenItems.removeClass(this.hideCls);
		}
		else {
			this.hiddenItems.addClass(this.hideCls);
		}
	},

	addEvents: function() {
		this.showMoreBtn.click($.proxy(this.onShowMoreButtonClick ,this));
	}

};
app.view.VerticalMenu = function() {
	this.init();
	this.bind();
};

app.view.VerticalMenu.prototype = {

	// Vertical menu id
	verticalMenuId: '#slide-menu',
	// Slider container id
	sliderContainerId: '#slide-container',
	// Content margin value
	contentMargin: 30,

	init: function () {
		this.verticalMenu = $(this.verticalMenuId);
		this.calculateMenuPosition();
	},

	calculateMenuPosition: function() {
		this.verticalMenuTop = this.verticalMenu.get(0).offsetTop;
		this.verticalMenuHeight = this.verticalMenu.get(0).clientHeight;
		this.content = $(this.sliderContainerId);
	},

	setPosition: function() {
		var contentHeight = this.content.get(0).clientHeight - this.contentMargin;
		var scrollTop = window.pageYOffset;
		if (scrollTop > (contentHeight - this.verticalMenuHeight)) {
			this.verticalMenu.css('top', contentHeight - this.verticalMenuHeight + this.verticalMenuTop - scrollTop + 'px');
		}
		else {
			this.verticalMenu.css('top', 'auto');
		}
	},

	onResize: function() {
		this.calculateMenuPosition();
	},

	onScroll: function() {
		this.setPosition();
	},

	bind: function() {
		$(window).on('resize', $.proxy(this.onResize, this));
		$(document).on('scroll', $.proxy(this.onScroll, this));
	}

};
app.page.all = function() {
	console.info('#Runningalll');
	new app.view.CodeMirror();
	new app.view.MobileMenu();
	new app.view.GoogleSearch();
};

app.page.home = function() {
	app.$carousel = new Flickity('.flickity', {
		wrapAround: true,
		prevNextButtons: false
	});

	$(".box p").ellipsis({
		lines: 3,
		responsive: true
	});
	$('.carousel-section').parallax({imageSrc:  siteConfig.baseUrl  + '/img/pattern-cover.jpg'});
	new app.ReadMore('.features', true);
	particlesJS.load('particles-js', 'assets/particles.json', function() {});

};

app.page.docs = function() {
	new app.view.VerticalMenu();

	$('.code-snippets').each(function(number, snippet) {
		new app.ReadMore(snippet, "Show more »", "« Show less");
	});

	$(".box p").ellipsis({
		lines: 3,
		responsive: true
	});
};

app.page.blog = function() {
	$(".box p").ellipsis({
		lines: 3,
		responsive: true
	});
	new app.view.VerticalMenu();
};

app.page.downloads = function() {
	new app.view.Clipboard();
};

app.page.post = function() {
	new app.view.VerticalMenu();
};
